export default function Result(props) {
	const termsArray = props.terms;

	//count the number of 1s in the third element of every array in termsArray
	let learning = 0;
	let mastered = 0;
	let unknown = 0;
	for (let i = 0; i < termsArray.length; i++) {
		if (termsArray[i][2] === 0) {
			unknown++;
		}
		if (termsArray[i][2] === 1 || termsArray[i][2] === 2) {
			learning++;
		}
		if (termsArray[i][2] === 3) {
			mastered++;
		}
	}

	return (
		<div className="relative space-y-5 block p-6 max-w-sm bg-white rounded-lg border border-gray-200 shadow-md  dark:bg-gray-800 dark:border-gray-700 h-52">
			<ul class="w-48 text-sm font-medium text-gray-900 bg-white rounded-lg border border-gray-200 dark:bg-gray-700 dark:border-gray-600 dark:text-white">
			<li class="py-2 px-4 w-full border-b border-gray-200 dark:border-gray-600">Unknown {unknown}</li>
				<li class="py-2 px-4 w-full rounded-t-lg border-b border-gray-200 dark:border-gray-600">Learning {learning}</li>
				<li class="py-2 px-4 w-full border-gray-200 dark:border-gray-600">Mastered {mastered}</li>
			</ul>
			<p className="dark:text-slate-400">Struggling with : </p>
		</div>
	);
}
